        private void GenerateVectorIconDictionary()
        {
            this.VectorIconDictionary = new Dictionary<IconCollection, VectorData>();

            foreach (IconCollection icon in Enum.GetValues(typeof(IconCollection)))
            {
                if (!this.VectorIconDictionary.ContainsKey(icon))
                {
                    this.VectorIconDictionary.Add(icon, GenerateVectorData(icon));
                }
            }
        }

        public bool ContainsByName(string name)
        {
            return this.VectorIconDictionary.Any(x => Enum.GetName(typeof(IconCollection), x.Key) == name);
        }

        public ImageIcon GetIconByName(string name, bool containsControl = true)
        {
            if (containsControl)
            {
                if (this.ContainsByName(name))
                    return new ImageIcon() { Icon = this.VectorIconDictionary.First(x => Enum.GetName(typeof(IconCollection), x.Key) == name).Key };
                else
                    return new ImageIcon() { Icon = IconCollection.None };
            }
            else
                return new ImageIcon() { Icon = this.VectorIconDictionary.First(x => Enum.GetName(typeof(IconCollection), x.Key) == name).Key };
        }

        /// <summary>
        /// ErtAwesome
        /// Constructor
        /// </summary>
        private IconManager()
        {
            this.GenerateVectorIconDictionary();
        }
    }
